import React from "react";
import "./index.css";
import bro from"./Used Images/bro.png";

function HomePage() {
    return (<>
    <div class="container-fluid baground position-relative">
        <center class="d-grid gap-2 col-8 mx-auto">
            <div className="container-fluid">
                <h3 class="">Elevate <span className="fw-bold">Real Estate Success</span> with</h3>
                <h3 class="">Osumare's Digital Expertise</h3>
                <p class="">Tailored Solutions for Thriving in the Digital Real Estate Landscape</p>
                
                    <button class="d-grid col-2 mx-auto btn btn-primary rounded-pill" type="button">Get started</button>
            
            </div>
            <div>
                <img src={bro}/>
            </div>
        </center>
        </div>

    </>);
}
export default HomePage;
